import React from 'react';

function User({ user }) {
    return (
      <div>
        <b>{user.username}</b> <span>({user.email})</span>
      </div>
    );
  }

  function AlarmListInfo() {
    const users = [
      {
        email: 'test1@gmail.com'
      },

      {
        email: 'test2@gmail.com'
      },

      {
        email: 'test3@gmail.com'
      }
    ];

    return (
      <div>
          <User user={users[0]} />
      <User user={users[1]} />
      <User user={users[2]} />
      </div>
    );
  }
  export default User;
